// import logo from './logo.svg';
import React, { useState } from 'react'
import './App.css';
// import Mydemo from './Mydemo';
import Navbar from './Navbar';
import TextBox from './TextBox';

function App() {
  const {mode,setmode} =useState('light');
  const toggle=()=>{
    if(mode === 'light'){
      setmode('dark');
    }
    else{
      setmode('light');
    }
  }
  return (
    <div >
    {/* <Navbar/> */}
    <Navbar title="Portfolio" about="About" dMode ="toggle"/> 
    {/* <Mydemo/> */}
    <TextBox heading="Enter the text to analyze"/>
    </div> 
  );
}

export default App;
